import React from "react";

const VideoList = () => {
  return (
    <div className="ui right floated segment">
      <div className="ui placeholder">
        <div className="image header">
          <div className="line" />Header</div>
          <div className="line" />Content</div>
    </div>
  );
};

export default VideoList;
